import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold mb-6 text-center">Welcome to Vehicle Sales Management</h1>
      <p className="text-lg text-gray-700 text-center">
        Browse our wide selection of vehicles or manage your sales as an admin.
      </p>
    </div>
  );
};

export default Home;
